def orientation(p, q, r):
    """Find orientation of triplet (p, q, r)."""
    val = (q[1] - p[1]) * (r[0] - q[0]) - (q[0] - p[0]) * (r[1] - q[1])
    if val == 0:
        return 0  # Collinear
    return 1 if val > 0 else 2  # Clockwise or Counterclockwise

def convex_hull_divide_conquer(points):
    """Find the convex hull of a set of points using Divide and Conquer."""
    def _divide_conquer(points):
        if len(points) <= 3:
            return points

        # Sort points by x-coordinate
        points.sort()

        # Divide the set of points into two halves
        mid = len(points) // 2
        left_half = points[:mid]
        right_half = points[mid:]

        # Recursively find the convex hull of each half
        left_hull = _divide_conquer(left_half)
        right_hull = _divide_conquer(right_half)

        # Merge the convex hulls of the two halves
        return merge_hulls(left_hull, right_hull)

    def merge_hulls(left_hull, right_hull):
        """Merge the convex hulls of two sets of points."""
        def keep_left(hull, point):
            while len(hull) > 1 and orientation(hull[-2], hull[-1], point) != 2:
                hull.pop()
            return hull.append(point) or hull

        def merge(hull1, hull2):
            """Merge two convex hulls."""
            hull1.extend(hull2)
            merged_hull = []
            for point in hull1:
                keep_left(merged_hull, point)
            return merged_hull

        return merge(left_hull, right_hull)

    # Main function call
    if len(points) < 3:
        return "Convex hull not possible with less than 3 points."

    return _divide_conquer(points)

# Example usage:
points = [(0, 3), (1, 1), (2, 2), (4, 4), (0, 0), (1, 2), (3, 1), (3, 3)]
convex_hull = convex_hull_divide_conquer(points)
print("Convex Hull:", convex_hull)

"""#Median Finding

Source: https://brilliant.org/wiki/median-finding-algorithm/
"""

def median_of_medians(A, i):

    #divide A into sublists of len 5
    sublists = [A[j:j+5] for j in range(0, len(A), 5)]
    medians = [sorted(sublist)[len(sublist)//2] for sublist in sublists]
    if len(medians) <= 5:
        pivot = sorted(medians)[len(medians)//2]
    else:
        #the pivot is the median of the medians
        pivot = median_of_medians(medians, len(medians)//2)

    #partitioning step
    low = [j for j in A if j < pivot]
    high = [j for j in A if j > pivot]

    k = len(low)
    if i < k:
        return median_of_medians(low,i)
    elif i > k:
        return median_of_medians(high,i-k-1)
    else: #pivot = k
        return pivot

